import React, { Component } from 'react';
import Search from '../search/Search';

class Filter extends Component {
  constructor(props) {
      super();
      this.state = {
          durationSet: false
      }
  }
  render() {
      return (
          <div>
            <Search />
            <button className="btn">Teacher</button>
            <button className="btn" data-toggle="true" aria-haspopup="true">Duration</button>
            <button className="btn">Level</button>
            <button className="btn">Style</button>
            <button className="btn">Anatomy</button>
          </div>

      )
  }
}

export default Filter;
